            <img className='onlineIcon' src={onlineIcon} />
            <h3>{room}</h3>
        </div>
        <div className='rightInnerContainer'>
            <a href="/"><img src={closeIcon} alt='close image'/></a>
        </div>
    </div>
}
export default InfoBar;
